for i in range(len(data)):
	data[i] = data[i].replace( '0', 'white ' ).replace( '1', 'black ' )


# Render ---

image_idx = 0

def updateImage():

	global image_idx

	img.put( data[image_idx], to = (0, 0, width, height) ) # update image

	image_idx = ( image_idx + 1 ) % len(data)  # increment index

	# print( image_idx )

	root.after( 500, updateImage ) # set timer

updateImage()


root.mainloop()